import React from 'react'
import './Header.css'
import SearchIcon from '@mui/icons-material/Search';
import HeaderOption from './HeaderOption';
import HomeIcon from '@mui/icons-material/Home';
import SupervisorAccountIcon from '@mui/icons-material/SupervisorAccount';
import BusinessCenterIcon from '@mui/icons-material/BusinessCenter';
import ChatIcon from '@mui/icons-material/Chat';
import NotificationsIcon from '@mui/icons-material/Notifications';

const Header = () => {
  return (
      <div className='header'>
          <div className='header__left'>
              <img src='https://static.vecteezy.com/system/resources/previews/018/930/587/original/linkedin-logo-linkedin-icon-transparent-free-png.png'
                  alt=''
              />
              <div className='header__search'>
                  <SearchIcon />
                  <input  type='text'/>
              </div>
          </div>  

          <div className='header__right'>
              <HeaderOption Icon={HomeIcon}  title='Home' />
              <HeaderOption Icon={SupervisorAccountIcon} title='My Network' />
              <HeaderOption Icon={BusinessCenterIcon} title='Jobs' />
              <HeaderOption Icon={ChatIcon} title='Messaging' />
              <HeaderOption Icon={NotificationsIcon} title='Notifications' />
              <HeaderOption avatar='https://media.gettyimages.com/id/1325105287/photo/portugal-v-france-uefa-euro-2020-group-f.jpg?s=594x594&w=gi&k=20&c=D3y5JltMoT0XjAv5glX7Xh0rQeopOjmUI7T8NQZd2Zc=' title='me' />
          </div>
      </div>
  )
}

export default Header
